import {Fragment} from "react";
import "./Main.css";
import Advert from "./advert/advert";

function Main() {
    const __COMPONENT__ = 'main';
    let url, name, price, city;

    url = 'data:image/jpeg;base64,';
    name = 'Загородный дом';
    price = 30000000;
    city = 'Ростов-на-Дону';

    const advert = [url, name, price, city];
    return (
        <Fragment>
            <div className={__COMPONENT__}>
                <Advert url={advert[0]} name={advert[1]} price={advert[2]} city={advert[3]} />
            </div>
        </Fragment>
    );
}

export default Main;
